script: |
  super -f tsv -I q3505.sql | sort > q3505.out

vector: true

inputs:
  - name: q3505.sql
    data: |
      SELECT tab1.col2 AS col0 FROM tab1 WHERE - col1 NOT BETWEEN ( col0 / + col0 + - col0 * + col2 / - col2 ) AND ( - col0 + col0 / col1 );
  - name: tab1

outputs:
  - name: q3505.out
    data: |
      54
      57
      96
